import React from 'react';
import about from '../img/about.png'
function ImageSection(){
    return (
        <div className="ImageSection">
            <div className="img">
                <img src={about} alt=""/>
            </div>
            <div className="about-info">
                <h4>I am</h4><span>Vrudit Patel</span>
                <p>
                    Pursuing B.E. in computer engineering at Shree Swaminarayan Institute Of Technology, Bhat, Gandhinagar
                    Under Gujarat Technological University, Ahemedabad.
                </p>
                <div className="about-details">
                    
                </div>
            </div>
        </div>
    );
}

export default ImageSection;
